    class User{
        private long id;
        private String name;
        private int age;
        private String sex;

        public User(long id, String name, int age, String sex) {
            this.id = id;
            this.name = name;
            this.age = age;
            this.sex = sex;
        }

        public long getId() {
            return id;
        }

        public void setId(long id) {
            this.id = id;
        }

        public String getName() {
            return name;
        }

        public void setName(String name) {
            this.name = name;
        }

        public int getAge() {
            return age;
        }

        public void setAge(int age) {
            this.age = age;
        }

        public String getSex() {
            return sex;
        }

        public void setSex(String sex) {
            this.sex = sex;
        }
    }
    enum Sex{
        MAN(1,"man"),WOMAN(2,"woman");
        private int code;
        private String sex;
        private Sex(int code,String sex){
            this.code =code;
            this.sex = sex;
        }

        public int getCode() {
            return code;
        }

        public void setCode(int code) {
            this.code = code;
        }

        public String getSex() {
            return sex;
        }

        public void setSex(String sex) {
            this.sex = sex;
        }

        public static Sex getSexByCode(int code){
            for(Sex sex:Sex.values()){
                if (sex.getCode()==code) return sex;
            }
            return null;
        }
    }

